  // [[*id:is=`49`:then=`[[$isotopeSizer]]`]]       News Page 
  // [[*id:is=`51`:then=`[[$isotopeSizer]]`]]       People News Page 
  // [[*id:is=`10`:then=`[[$isotopeSizer]]`]]       Media Page 
  // [[*parent:is=`10`:then=`[[$isotopeSizer]]`]]       Media Child Page 
  // [[*id:is=`2`:then=`[[$isotopeSizer]]`]]       Clients Page 
  var $isotopeSizer = $('.isotopeSizer').isotope({
    // options
    itemSelector: '.item',
    masonry: {
      columnWidth: '.grid-sizer',
      gutter: '.gutter-sizer'
    }
  });
  // layout Isotope again after all images have loaded
  $isotopeSizer.imagesLoaded( function() {
    $isotopeSizer.isotope('layout');
  });


// END isotopeSizer

